import ToggleTask from "./ToggleTask"
import TaskDetail from "./TaskDetail"

const TaskList = ()=>{
    return(
        <>
            <ToggleTask/>
            <TaskDetail/>
            <TaskDetail/>
            <TaskDetail/>
        </>
    )
}

export default TaskList
